{% assign Person = Workflow | Attribute:'Person','Object' %}
{% sql %}
SELECT concat(cpa.PersonId,'|', string_agg(cr.Id,';')) as PersonId
from PersonAlias pa 
inner join connectionrequest cr 
    ON cr.PersonAliasId = pa.Id
inner join PersonAlias cpa 
    ON cpa.Id = cr.ConnectorPersonAliasId
where pa.PersonId = {{ Person.Id }} 
    and cr.ConnectionTypeId = 4 
    and cr.ConnectionState in (0,2)
group by cpa.PersonId{% endsql %}
{{ results | Map:'PersonId' | Join:',' }}

